import React from 'react';
import PropTypes from 'prop-types';

const Book = ({ id }) => {
  return (
    <div>
      <h1>Book / {id}</h1>
    </div>
  );
};

Book.propTypes = {
  id: PropTypes.number.isRequired,
};

export default Book;
